import React from 'react';

const TableFoot = ({title,name_text}) => {
    return (

        <div className="component_foot">
            <div className="title_text">{title}</div>
            <div className="main_text">
                {name_text.map(item)}
                <div className="ul_text">{name_text[1]}</div>
                <div className="ul_text">Our Testimonials</div>
                <div className="ul_text">Partners</div>
            </div>
        </div>
    );
};

export default TableFoot;
